#include "wp43s.h"

/********************************************//**
 * \brief Dummy function for a function to be coded
 *
 * \param[in] unusedParamButMandatory uint16_t
 * \return void
 ***********************************************/
void toBeCoded(uint16_t unusedParamButMandatory) {
  #if (LOG_FUNCTIONS == 1)
    enteringFunction("toBeCoded");
  #endif

  funcOK = false;

  #if (LOG_FUNCTIONS == 1)
    leavingFunction("toBeCoded");
  #endif
}



/********************************************//**
 * \brief No OPeration
 *
 * \param  unusedParamButMandatory uint16_t
 * \return void
 ***********************************************/
void fnNop(uint16_t unusedParamButMandatory) {
  #if (LOG_FUNCTIONS == 1)
    enteringFunction("fnNop");
  #endif


  #if (LOG_FUNCTIONS == 1)
    leavingFunction("fnNop");
  #endif
}



/********************************************//**
 * \brief Runs a function
 *
 * \param[in] fn int16_t Index in the indexOfItems area of the function to run
 * \return void
 ***********************************************/
void runFunction(int16_t fn) {
  funcOK = true;

  #if (LOG_FUNCTIONS == 1)
    enteringFunction("runFunction");
  #endif

  fn %= 10000;

  if(calcMode!=CM_TAM && indexOfItems[fn].param>=10000) {
    tamFunction = fn;
    tamMode = indexOfItems[fn].param % 10000;
    strcpy(tamBuffer, indexOfItems[tamFunction].itemPrinted);
    tamNumberMin = 0;
    if(fn == ITM_FIX || fn == ITM_SCI || fn == ITM_ENG || fn == ITM_ALL || fn == ITM_DSP || fn == ITM_GAP) {
      tamNumberMax = 15;
    }
    else if(fn == ITM_toINT) {
      tamNumberMin = 2;
      tamNumberMax = 16;
    }
    else if(fn == ITM_DSTACK) {
      tamNumberMin = 1;
      tamNumberMax = 4;
    }
    else if(fn == ITM_STO || fn == ITM_RCL) {
      tamNumberMax = 99;
    }
    else if(fn == ITM_WSIZE) {
      tamNumberMax = 64;
    }
    else {
      tamNumberMax = 0;
    }

    calcModeTAM();

    #if (LOG_FUNCTIONS == 1)
      leavingFunction("runFunction");
    #endif

    return;
  }

  indexOfItems[fn].func(indexOfItems[fn].param);

  if(indexOfItems[fn].stackLiftStatus == SLS_DISABLED) {
    #if (STACK_LIFT_DEBUG == 1)
      stackLiftDisable();
    #else
      stackLiftEnabled = false;
    #endif
  }
  else if(indexOfItems[fn].stackLiftStatus == SLS_ENABLED) {
    #if (STACK_LIFT_DEBUG == 1)
      stackLiftEnable();
    #else
      stackLiftEnabled = true;
    #endif
  }

  #ifdef PC_BUILD
    if(!funcOK) {
      sprintf(errorMessage, "%" FMT16S " = %s", fn, indexOfItems[fn].itemPrinted);
      showInfoDialog("In function runFunction:", "Item not implemented", errorMessage, "to be coded");
    }
  #endif

  #if (LOG_FUNCTIONS == 1)
    leavingFunction("runFunction");
  #endif
}



